import React from "react";
import "./card.css";

const Card = ({ message, callback }) => {
  return (
    <div class="country-card">
      <img
        className="flag-box"
        src={message}
      />
     <button  onClick={() => callback("home")}>
         Back to home
      </button>
    </div>
  );
};

export default Card;
